class Solution:
    def solution(self, stdin: str) -> str:
        s = stdin
        s = s.lstrip('0')
        if len(s) == 0:
            return "0"
        n = len(s)
        count = 0
        i = 0
        while i < n:
            if s[i] == '3':
                count += 1
                i += 1
            else:
                i += 2
        return str(count)

