class CoconutSplatGame:
    def __init__(self, n_players, syllables):
        self.n_players = n_players
        self.syllables = syllables
        self.start_player = 1
        self.players_left = self.n_players
        self.hands_folded = self.n_players * [False]

    def run_game(self):
        current_player = self.start_player - 1
        while self.players_left > 1:
            current_player = (current_player + 1) % self.n_players
            if self.hands_folded[current_player]:
                continue
            self.hands_folded[current_player] = self.split_coconut(current_player)

    def split_coconut(self, player):
        if self.hands_folded[player]:
            return False
        hands_touched = self.syllables % self.n_players
        if hands_touched == 0:
            hands_touched = self.n_players
        for _ in range(hands_touched):
            player = (player + 1) % self.n_players
            if self.hands_folded[player]:
                continue
            self.hands_folded[player] = True
            self.players_left -= 1
        return True

